<!DOCTYPE html>
<html lang="en">
<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>LAH.inc</title>
    <link rel="icon" href="https://media0.giphy.com/avatars/Eshopakigr/kGBRTpZQu9lF.gif" type="image/png">
    <style>
        body {
            font-family: Arial, sans-serif;
            background-color: #f2f2f2;
            text-align: center;
            margin: 0;
            padding: 0;
        }

        h1 {
            color: #333;
        }
        h2{
        color: #333;
        }
        #password-form {
            background-color: #fff;
            padding: 30px;
            border-radius: 10px;
            box-shadow: 0 0 10px rgba(0, 0, 0, 0.2);
            margin: 5% auto;
            width: 80%;
            max-width: 300px;
        }

        label {
            display: block;
            margin-bottom: 10px;
            font-weight: bold;
        }

        input {
            width: 100%;
            padding: 10px;
            margin-bottom: 15px;
            box-sizing: border-box;
        }

        button {
            background-color: #007BFF;
            color: #fff;
            padding: 10px 20px;
            border: none;
            border-radius: 5px;
            cursor: pointer;
            width: 100%;
        }

        button:hover {
            background-color: #0056b3;
        }

        #content {
            background-color: #fff;
            padding: 20px;
            border-radius: 5px;
            box-shadow: 0 0 10px rgba(0, 0, 0, 0.2);
            margin: 20px auto;
            width: 80%;
            max-width: 300px;
            display: none;
        }

        .error-message {
            color: #ff0000;
            margin-top: 10px;
        }

        #content a {
            font-weight: bold;
            text-decoration: none;
            color: black;
        }
    </style>
</head>
<body>

<h1>Welcome Cadets</h1>
<h2>By Pablo </h2>

    <label for="password">Enter the password:</label>
    <input type="password" id="password">
    <button onclick="checkPassword()">Submit</button>
    <div id="error-message" class="error-message"></div>
</div>

<script>
 
const correctPasswordHash = "b78ba299555b4d1c3bd6959d5149098077b90191";

function checkPassword() {
    const passwordInput = document.getElementById("password").value;
    const errorMessage = document.getElementById("error-message");

     
    const encoder = new TextEncoder();
    const data = encoder.encode(passwordInput);
    crypto.subtle.digest("SHA-1", data).then(function(hash) {
        var hashArray = Array.from(new Uint8Array(hash));
        var hashHex = hashArray.map(byte => byte.toString(16).padStart(2, '0')).join('');

        if (hashHex === correctPasswordHash) {
            document.getElementById("password-form").style.display = "none";
            document.getElementById("content").style.display = "block";
            errorMessage.textContent = "";  
        } else {
            errorMessage.textContent = "Incorrect password. You will be redirected to Google.com.";
            
            
            setTimeout(function() {
                window.location.href = "https://www.google.com";
            }, 2000);
        }
    });
}
